  const board = Array(9).fill(null);

  const printSquares = () => {
    let divs = [];
    for (let i = 0; i < quantity; i++) {
      divs.push([
        <div
          key={i}
          className='square'
          data-index={i}
          onMouseOver={handleOnMouseOver}
          onMouseLeave={handleOnMouseOut}
          onMouseDown={handleMouseDown}
          onMouseUp={handleMouseUp}
        ></div>,
      ]);
    }
    return divs.map((div) => div);
  };
  return (
    <>
      <div className='b-row first-row'>{printSquares(3)}</div>
      <div className='b-row second-row'></div>
      <div className='b-row third-row'></div>
    </>
  );
}
